import './styles/App.css';
import react from 'react';
import { Box } from '@mui/system';
import { Grid } from '@mui/material';

class App extends react.Component {

  constructor(props) {
    super(props)
  }

  render() {
    return (
      <div className="main-container">
        <Box padding="10px" height="100%" display="flex" justifyContent="center" margin="10px">
          <Grid container spacing={2}>
            <Grid item md={2}>
              <h2>Test</h2>
              Hello World
            </Grid>
            <Grid item md={2}>
              Hello World
            </Grid>
            <Grid item md={8}>
              Hello World
            </Grid>
          </Grid>
        </Box>
      </div>

    );
  }

}

export default App;
